export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},xZyH7cwH5m:{data:{id:945,attributes:{imdbId:"tt0085478",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNTI1NjA3ODMtYTM0ZC00ZGEzLWE0OWEtMDgwOTQ2NjhhYjFjXkEyXkFqcGdeQXVyMTk0MjQ3Nzk@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.2\u002F10"},{Source:"Rotten Tomatoes",Value:"80%"},{Source:"Metacritic",Value:"52\u002F100"}],item_lang:{data:{id:1608,attributes:{title:c,plot:"In Liverpool, twenty-seven-year-old hairdresser Rita (Dame Julie Walters) decides to complete her basic education before having children, as desired by her husband Denny (Malcolm Douglas). She joins a literature course in an open university and is tutored by the middle-aged Dr. Frank Bryant (Sir Michael Caine), an alcoholic and debauched professor from the upper-class, whose life has left him emotionally drained, without self-esteem. Frank lives with Julia (Jeananne Crowley), who's also a professor, and has a loveless marriage. Julia has a love affair with Dean Brian (Michael Williams). Rita's humor and determination to improve herself is contagious. She gives motivation to Frank, who helps prepare her for the exams to join the university, and be able to leave Denny. Will she succeed in the exams?",slug:"educating-rita"}}},books:{data:[{id:5617,attributes:{title:c,description:"Educating Rita, about a working-class Liverpool girl's hunger for education, is 'simply a marvellous play, painfully funny and passionately serious; a hilarious social documentary; a fairy-tale with a quizzical, half-happy ending.' Sunday Times Educating Rita premiered at the RSC Warehouse, London, in June 1980. Voted Best Comedy of 1980, it was subsequently made into a highly successful film with Michael Caine and Julie Walters.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uV0QAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2013-04-05",publisher:h,subtitle:d}},{id:5618,attributes:{title:c,description:"'One way of describing Educating Rita would be to say that it was about the meaning of education ... Another would be to say that it was about the meaning of life. A third, that it is a cross between Pygmailion and Lucky Jim. A fourth, that it is simply a marvellous play, painfully funny and passionately serious; a hilarious social documentary; a fairy-tale with a quizzical, half-happy ending.' Sunday Times Educating Rita, which portrays a working-class Liverpool woman's hunger for education, premiered at the RSC Warehouse, London, in 1980 and won the SWET award for Best Comedy of the Year. It was subsequently made into a highly successful film with Michael Caine and Julie Walters and won the 1983 BAFTA award for Best Film. Commentary and notes by Steve Lewis.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pwf4RNaQdMEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2013-06-06",publisher:"A&amp;C Black",subtitle:d}},{id:5619,attributes:{title:"Russell Plays: 1",description:"Breezeblock Park is set on a northern council estate and takes a look at the suffocating effect of possessions and possessiveness: \"Trenchantly observed...hilarious, upsetting and somewhat seditious.\" (Variety); Our Day Out is about a school coach trip, an exuberant celebration of the joys and agonies of growing up - \"a Dickensian fairytale...I have rarely seen a show that combined such warmth and such bleakness.\"(The Times); Stags and Hens \"takes place in the gents and Ladies loos of a tacky Liverpool club, where Dave and Linda have decided, unbeknownst to each other to hold their stag and hen parties...a bleakly funny and perceptive study of working-class misogyny, puritanism and waste\" (Guardian); Educating Rita: \"one way of describing Educating Rita would be to say that it was about the meaning of education...another would be to say that it was about the meaning of life. A third, that it is a cross between Pygmalion and Lucky Jim. A fourth, that it is simply a marvellous play, painfully funny and passionately serious: a hilarious social documentary; a fairy-tale with a quizzical, half-happy ending.\" (Sunday Times)",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=RKYVAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2013-12-17",publisher:h,subtitle:"Breezeblock Park; Our Day Out; Stags and Hens; Educating Rita"}},{id:5620,attributes:{title:"Educating Rita ; Stags and Hens ; And, Blood Brothers",description:d,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MydaAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"1986-01-01",publisher:"Methuen Drama",subtitle:"Two Plays and a Musical"}},{id:5621,attributes:{title:c,description:"A Student Edition of the classic play, with full introduction, commentary, notes on the text and questions for study.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=HLqpSgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,"John Shuttleworth"],firstBook:e,published:"2000-01-01",publisher:"Longman Schools Division (a Pearson",subtitle:d}}]}}},meta:{}}},prerenderedAt:1681703548005}}("Willy Russell","movie","Educating Rita","",null,"series",1,"A&C Black"))